(1, 'About', '<p>AutoTech Locksmith Supply was Established in 2010 we are privately own corporation. Our headquarter is located in Miami Florida. When it comes to supplying transponder keys, automotive keyless entry remotes and programing. We supply to National and international distributors AutoTech Locksmith Supply is Changing the landscape of the key and keyless remote entry sales worldwide. </p>\r\n<h1>Return Policy</h1>\r\n<p>For items other than electronic merchandise and software, returns are allowed within 30 days of invoice. All electronic merchandise and software are non-refundable. Items must be in original condition, unopened, and uninstalled. All returned goods are subject to 15% minimum restocking fee. Warranties are subject to manufacturerâ€™s policy.</p>\r\n<p>Transportation costs must be paid by the customer returning merchandise and all risks of loss or damage of goods in transit are the responsibility of the customer. No credit will be issued for product received damaged.</p>\r\n\r\n<strong>Please feel free to contact us with any questions or concern we''re here to help.</strong>\r\n\r\n\r\n<img border="0" src="/images/autotechsupply.jpg" alt=test" width="225" height="65" />\r\n<pre>Â </pre>\r\n<h1><span style="color: #264949;"><em>AutoTech Locksmith Supply.</em></span></h1>\r\n<p>7294 NW 8 St.<br /> Miami Florida, 33126<br /> Tel. 1-866-919-2956<br /> Tel. 305-915-5306<br />Fax. 305-266-7744<br />Email: <a href=contact_us.php>Contact us</a><br />Web: http://www.autotechlocksmith.com</p>', 1),
