(155, 1, 'AE Z Flasher', '<img border="0" src="/images/aetools.png" alt="test" width="225" height="65" />\r\n\r\n<p>The AE Z Flasher is the ultimate interface for communicating with newer automobiles, heavy duty trucks, and can netwrorks. It has both Ethernet and USB connectivity to PC, a built-in analog inputs.\r\n\r\nNo other J2534 tools on the market has the performance and capabilities of the AE Z Flasher. It is upgradeable thru firmware updates and expansion slots.\r\n\r\nThis is the best tool to have for Programming, Re-programming, Keyw Programming and More...</p>\r\n\r\n<h1>Specifications</h1><hr/>\r\n\r\n   <p style="background-color:#FFFF00">\r\nBus Protocols</p><hr/>\r\n\r\n      > CAN/ISO 15765/GMLAN<hr/>\r\n      > 2nd CAN (Dual or Single Wire)<hr/>\r\n      > Ford SCP (J1850VPW)<hr/>\r\n      > GM Class2 (J1850VPW)<hr/>\r\n      > KWP2000 (ISO9141/14230)<hr/>\r\n      > Chrysler SCI (J2610)<hr/>\r\n   \r\n   <p style="background-color:#FFFF00">\r\nPC Interfaces</p><hr/>\r\n\r\n      > USB (now included)<hr/>\r\n      > Wired RJ45 Ethernet<hr/>\r\n      > Optional 802.11 WiFi<hr/>\r\n\r\n   <p style="background-color:#FFFF00">\r\nOther</p><hr/>\r\n\r\n      > Compliant to SAE J2534 (FEB 2002) and SAE J2534-1 \r\n        (Dec 2004)<hr/>\r\n      > Compliant to ISO 22900-1 MVCI physical layer<hr/>\r\n      > Programming voltage on J1962 pin 6,9,11,12,13,14 or Aux<hr/>\r\n      > General purpose analog inputs (0-27V, 2Ksps, 12 bit)<hr/>\r\n      > Ground pins 9, 12, or 15<hr/>\r\n      > Internal Compact Flash slot (must be configured when ordeting)<hr/>\r\n      > Optional external Compact Flash slot<hr/>\r\n\r\n   <p style="background-color:#FFFF00">\r\nProduct Specifications  </p><hr/>\r\n\r\n      > Operating voltage: 7-26 Volts<hr/>\r\n      > Size: 1.25"H x 7.5"D x 5.25"W<hr/>\r\n      > Operating Temperature: Commercial Range (0 to +70 C)<hr/>\r\n\r\n   <p style="background-color:#FFFF00">\r\nFunctions</p><hr/>\r\n      \r\n      > J2534 Independet Repair Facility reprogramming tool<hr/>\r\n      > Bench top ECU reprogramming<hr/>\r\n      > In-Vehicle ECU reprogramming<hr/>\r\n      > OBD2 Diagnostics using PCMSCAN and other 3red party applications<hr/>\r\n      > In-vehicle pass-thru data logging.<hr/>\r\n      > Standalone data logging or monitoring\r\n      > Fleet or public transportation data acquisition<hr/>\r\n      > OEM Engineering<hr/>\r\n      > OEM calibration reprogramming<hr/>\r\n      > End of line testing<hr/>\r\n      > Dealer Service tools<hr/>\r\n      > 3rd party integrated<hr/>\r\n      > Specialized Customers<hr/>\r\n      > Volvo Key Pragramming<hr/>\r\n\r\n<p>The AEZ Flasher can interface with the following softwarefor module\r\nreprogramming and key reprogramming:</p><hr/>\r\n\r\n      > Techstream Light<hr/> \r\n      > TIS 2 web<hr/>\r\n      > Ford FMP<hr/>\r\n      > Tech Authority<hr/>\r\n      > Honda Web site<hr/>\r\n      > Kia Web site<hr/>\r\n      > Hyundia Web Site<hr/>\r\n      > J2534 DVD App<hr/> \r\n      > 3G Online<hr/>\r\n      > VIDA<hr/>\r\n      > Jag/Landrover IDS<hr/>\r\n      > VW Web Site<hr/>\r\n      > Mitsubushi Web Site<hr/>\r\n      > Nissan NERS<hr/>\r\n      > Custom Software Coming Soon<hr/>\r\n      > Also allows for remote software transfer from our office directly\r\n        to your car by network streaming!! NOW THAT''S WHAT I CALL COOL!!<hr/>', '', 2156),
