(773, 1, 'ATL-KEY MACHINE-2', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA DAKKI LASER KEY CUTTING MACHINE </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA DAKKI LASER KEY CUTTING MACHINE <br/> <br/>\r\n\r\nTehe DAKKI key cutting machine has been designed taking into account the safety standars currently in force in the EEC.<br/>\r\n<br/>\r\n\r\n\r\nMAIN ELEMENTS OF THE MACHINE.<br/> <br/>\r\n\r\n1. Clamp holder carriage (x-and Y-axes)<br/>\r\n2. Head (Z-axis)<br/>\r\n3. Clamp<br/>\r\n4. Clamp opening/ closing knob.<br/>\r\n5. Clamp holder carriage locking knob (X-axis)<br/>\r\n6. Head blocking knob (Z-axis)<br/>\r\n7. Tracer point locking knob (fixed/ springing)<br/>\r\n8. Tracer point adjustment wheel<br/>\r\n9. Carriage drive lever (X- and  y axes)<br/>\r\n10. Head drive lever (Z axis)<br/>\r\n11. Milling cutter holder head.<br/>\r\n12. Tracer point holder head <br/>\r\n13. Milling cutter<br/>\r\n14. Tracer point<br/>\r\n15. Master switch<br/>\r\n16. Start-up switch<br/>\r\n17. Motor switch.<br/><br/>\r\n\r\nDimension: Height = 378 mm; Width = 270 mm; Depth = 340 mm<br/>\r\nWeight: 18 kg.', '', 664),
