(766, 1, 'ATL-KEY MACHINE-3', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA DAKOTA EXTRA KEY CUTTING MACHINE </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA DAKOTA EXTRA KEY CUTTING MACHINE <br/><br/>\r\n\r\nSemi-automatic machine for cutting flat, cylinder, automotive, cross-shaped and special keys. It has a high precision 4-sided clamp, and a lateral carriage movement system for smooth key duplication which makes it a very complete machine.\r\n \r\nThe Dakota Extra incorporates a swarf tray, a tool storage tray and a halogen lamp. It also includes a tracer with micrometric adjustment system. <br/><br/>\r\n\r\nMotor: 220V, 50 Hz, 0.18Kw <br/>\r\nDimensions: 20â€ x 11â€ x 9 Â½â€<br/>\r\nWeight: 50.70 lbs.<br/>', '', 372),
(768, 1, 'ATL-KEY MACHINE-4', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1>JMA DAKAR EXPRESS LASER KEY CUTTING MACHINE  </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA DAKAR EXPRESS LASER KEY CUTTING MACHINE <br/><br/>\r\n\r\nJMA''s Top range machine with top level features for cutting security (dimple) keys, wave (laser) keys, tubular keys and special keys.\r\n \r\nQuick clamping system with a fixed clamp. Optional clamp for tubular and Fichet type keys.\r\n \r\nEquipped with a toolbox, light and above all cutter-tracer point adjustment by means of a system of lights. The tracer point shaft is equipped with a spring system for smoother machining of security keys.\r\n \r\n<br/><br/>\r\n \r\nTracer points : P1<br/>\r\nMotor: 220V-50Hz 200W<br/>\r\nCutters: F1<br/>\r\nSize and weight: 310 x 420 x 365; 27 KG', '', 298),
(769, 1, 'ATL-KEY MACHINE-5', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA ECCO PLUS KEY CUTTING MACHINE </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA ECCO PLUS KEY CUTTING MACHINE <br/><br/>\r\n\r\n\r\n\r\nHeavy Duty Semi Automatic key duplicator.\r\n \r\nAluminum frame design makes it very durable, precise and easy to use. The 2 sided jaws, lateral movement lever, start micro switch and brush make it a very complete duplicating machine.<hr/>\r\n\r\nMotor: 110V, 50 Hz, 0.18Kw  <br/>\r\nDimensions: 20 Â½â€ x 11â€ x 9 Â½â€  <br/>\r\nWeight: 35 lbs <br/>', '', 334),
(770, 1, 'ATL-KEY MACHINE-6', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA DAKAR LASER KEY CUTTING MACHINE </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA DAKAR LASER KEY CUTTING MACHINE <br/><br/>\r\n\r\nJMA''s top laser key machine.<br/>\r\nA heavy duty and well designed machine with numerous  cutter options and the ability to cut tubular keys and standard without any attachments. <br/><br/>\r\n\r\nSize: 310x365x420 mm.<br/>\r\nWeight: 25 Kg.', '', 325),
(771, 1, 'ATL-KEY MACHINE-7', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA PROCODE </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA PROCODE<br/><br/>\r\n\r\nElectronically controlled machine for cutting flat cylinder and automotive keys by code.\r\n \r\nStand-alone or PC assisted operation.\r\n \r\nThe Procode is a highly reliable, precise and safe to operate machine. Highly flexible when integrating new files. Optional features include an electromagnetic reader with centesimal sensitivity and a complete code program. <br/><br/>\r\n\r\nMotor: 110V-50Hz 0.18KW <br/> \r\nDimensions: 16 Â½â€ x 12â€ x 21â€<br/>\r\n Weight: 95 lbs<br/>', '1', 410),
(772, 1, 'ATL-KEY CLONING <br /> MACHINE-8', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA TPH MODULE FOR TRS5000 CLONER </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA TPH MODULE FOR TRS5000 CLONER <br/> <br/> \r\n\r\nJMA continues to revolutionize the market. The TRS-5000 + TPH CLONER is the best solution for copying 2nd GENERATION PHILIPSÂ® CRYPTO TRANSPONDERS. \r\n \r\nPhillips Encrypted Transponders are mainly used in GM, Chrysler, Mitsubishi and Nissan.\r\n \r\nBy using the TPH Cloner along with our proprietary TPX3 chips, stand alone cloning of Phillips Encrypted chips is fast and easy.\r\n \r\nDue to the level of encryption found in Phillips transponders, a simple at the car procedure is required in order to correctly clone a key', '', 536),
