(869, 1, 'ATL-KEY CLONING  <br />MACHINE-9', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA TPH CLONER<br /> + 10 TPX3 KEYS</h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\n<p>JMA continues to revolutionize the market. The TRS-5000 + TPH CLONER is the best solution for copying 2nd GENERATION PHILIPSÂ® CRYPTO TRANSPONDERS. \r\n \r\nPhillips Encrypted Transponders are mainly used in GM, Chrysler, Mitsubishi and Nissan.\r\n \r\nBy using the TPH Cloner along with our proprietary TPX3 chips, stand alone cloning of Phillips Encrypted chips is fast and easy.\r\n \r\nDue to the level of encryption found in Phillips transponders, a simple at the car procedure is required in order to correctly clone a key</p><hr/><hr/>\r\n\r\n <p style="background-color:#FFFF00">\r\nTPH CLONER + 10 TPX3 KEYS</p><hr/>\r\n\r\n<hr/>\r\n-          2 - TPX3CHR-15.P (Y164PT CLONEABLE)<hr/>\r\n-          2 - TPX3HOND-31.P (HOO3PT CLONEABLE)<hr/>\r\n-          2 - TPX3HOND-21.P (HD11PT CLONEABLE)<hr/>\r\n-          2 - TPX3MIT-8D.P2 (MIT17APT CLONEABLE)<hr/>\r\n-          2 - TPX3MIT-18D.P (MIT16APT CLONEABLE)<hr/><hr/>', '', 706),
(870, 1, '3-D Pro Laser Key Cutting Machine', '<img border="0" src="/images/lkp.png" alt="test" width="125" height="35" />\r\n\r\n<h1>3-D Pro Laser Key Cutting Machine</h1><hr/><hr/>\r\n\r\n<h1>DESCRIPTION</h1><hr/><hr/>\r\n\r\n\r\n<p>The best value in high security key cutting on the market by far install laser key product software on your laptop and start cutting keys right away. this machine really can be a completed replacement for the HPC blitz in your vans.</p><hr/><hr/>\r\n \r\n>cuts by code, including half-cuts <hr/>\r\n>decode keys, including high security keys with internal cuts. Compensates for wear and decodes back to factory< originals cuts<hr/>\r\n>Fully automatic calibration <hr/>\r\n>Includes 1/16â€™ end mill cutters and jaw for normal keys and 2.5mm cutter and jaw for all high applications.<hr/>\r\n>Includes VW adapter (HU66) and M-adapter for cutting thinner Mercedes keys.<hr/>\r\n>Designed for mobile applications. Bolt-sown kit available.<hr/>\r\n>Tibble jaw available <hr/>\r\n>Easily updated via the Internet <hr/>\r\n>Only 32lbs<hr/><hr/>', '', 6198),
