(1013, 1, 'ATL-DUC-1', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n\r\n\r\n<h1>DUCATI KEY SHELL KW17 </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nOEM # 59840183A    <hr/>\r\n\r\nJMA : TP00DCT-1.P<hr/>\r\n\r\nILCO : KW17T5-SI\r\n\r\nSILCA : KW17.T5 ( with transponder)<hr/>\r\n\r\nMODELS  <hr/> <hr/>\r\n\r\n 600 MONSTER : 2001 <hr/>\r\n\r\n 600 S : 2001  <hr/>\r\n\r\n 620 SPORT : 2003  <hr/>\r\n\r\n 620 MONSTER  DARK : 2005 +  <hr/>\r\n\r\n 749 :  2003+ <hr/>\r\n \r\n 800 SPORT : 2003  <hr/>\r\n\r\n 999  : 2003+ <hr/>\r\n\r\n 999 R :2003 +  <hr/>\r\n\r\n 999 S : 2003 +  <hr/>\r\n\r\n 1000 : 2003+ <hr/>\r\n\r\n MONSTER : 2001-2005+  <hr/>\r\n\r\n MONSTER S2R : 2005 + <hr/>\r\n\r\n MONSTER S4R : 2005 + <hr/>\r\n\r\n ST3 : 2005+ <hr/>\r\n\r\n ST4 : 2005+   <hr/>\r\n\r\n S4 :  2001+ <hr/>\r\n\r\n SPORT :  2001-2003+ <hr/>\r\n\r\n ST : 2002-2005 <hr/>', '', 282),
(1015, 1, 'ATL-DEC-25', '<h1>STAINLESS PICK SET 30 PIECES</h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/> \r\n\r\nUSAGE: <br/> <br/>\r\n\r\nSometimes high quality locks, expensive locks and auto locks are very difficult to open, specially autos, if simply using normal pick tools. These inique pick instruments are designed different from most conventional pick tools on the market and help locksmiths solve difficult problems.\r\n\r\n <hr/>\r\n\r\nFEATURE: <br/> <br/>\r\n\r\n- Longer size provides enough length to open autos. <br/>\r\n- It contains 20 most pick blade instruments and 10 different function tension tools to fit various cylinders. <br/>\r\n- Stylish streamlined handle, easy to hold.<br/>\r\n- Each pick handle and blade are thoroughly polished.\r\n\r\n\r\n <hr/>', '', 369),
(1016, 1, 'ATL-DEC-26', '<h1>  DINO PROFESSIONAL AUTO TENSION WRENCH</h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/> \r\n\r\nUSAGE: <br/> <br/>\r\n\r\nThis tool is specially designed for car opening use, which can provide locksmiths with a very steady tension feeling, which is very necessary for locksmith during a car opening job.\r\n\r\n <hr/>\r\n\r\nFEATURE: <br/> <br/>\r\n\r\nThis set include two different necessary sizes of gaps to fit every different car door cylinder. <br/>\r\nThe high flexibility of this tension wrench is different than most similar tools on the market and is made of special carbon steel material.\r\n\r\n <hr/>\r\n\r\n\r\nPART #: RGN - 215', '', 213);
INSERT INTO `products_description` (`products_id`, `language_id`, `products_name`, `products_description`, `products_url`, `products_viewed`) VALUES
(1017, 1, 'ATL-DEC-27', '<h1>  DINO ADJUSTABLE DOUBLE-SIDED CAR TENSION WRENCH SET</h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/> \r\n\r\nUSAGE: <br/> <br/>\r\n\r\nThis tool include 2 lengths and its width is adjustable to fit many various car cylinders. <br/>\r\nSometimes a very steady tension feeling is very important for car opening. Incorrect tension can waste time when picking.<br/>\r\nThis tension tool is special designed for car opening use. This is different than the other tension tools on the market and it can provide very steady tension.\r\n\r\n\r\n\r\n <hr/>\r\n\r\nOPERATION: <br/> <br/>\r\n\r\n1. Inspects car cylinder''s size and select which size to use.<br/> <br/>\r\n2. When you insert into car door cylinder, its suitable depth and different width will provide you are very accurate steady feeling to assist you to finish any car opening job easier and faster.\r\n\r\n <hr/>\r\n\r\n\r\nPART #: RGN - 216', '', 300),
