(1232, 1, 'ATL-BIC-1', '<h1>BIANCHI JAGUAR FORD TIBBE KEY CUTTING MACHINE</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\nPart Number: Focus<hr/>\r\nThe Focus machine is a manual machine designed to specifically cut Ford & Jaguar 6 cut Tibbe key by code.<hr/>\r\nCHARACTERISTICS<br/>\r\n \r\n1.It has a special clamp with a 360 degree selector for setting the cutting angle. <br/>\r\n2. Microswitch activated cutter start and stop give user additional safety; cutter will not start until safety shield is lowered.<br/>\r\n3. Independent soft touch deburring brush.<br/>\r\n\r\n<hr/>\r\n\r\nHeight: 10"<hr/>\r\n\r\nWidth: 14"<hr/>\r\n\r\nLength: 14.5"<hr/>\r\n\r\nWeight: 38 pounds<hr/>\r\n\r\nMotor: 180 W, 1350 rpm"<hr/>\r\n\r\nCutter: 76 mm high speed steel', '', 8),
(1233, 1, 'ATL-BIC-2', '<h1>LEXUS 80 000 CODE SERIES ADAPTER FOR 994</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nJAW C - GREEN <hr/>\r\n\r\nLS460: 2008 - 2011<hr/>\r\n\r\nTOYOTA SIENNA: 2011', '', 523),
(1234, 1, 'ATL-KL-1', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>KEYLINE 994 LASER KEY CUTTING MACHINE <br/>*included jaw a & c* </h1>\r\n\r\n\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe keyline Laser 994 is the most advanced electronic high security key cutting machine on the market. <hr/>\r\n\r\nCHARACTERISTICS<br/>\r\n\r\n1. Cuts by code, decode or depths and duplicates high security key.<br/>\r\n2. Universal 2.5 mm cutter is used for all aplications.<br/>\r\n3. Complete database of high security systems to be cut built - in, no computer is needed.<br/> \r\n4. Included A & C jaws to cut most popular high security laser key. B & D jaws are available as a optional equipment.<br/>\r\n5. Electronic Calibration.<br/>\r\n6. Key information is automatically converted to original lock specification when duplicating.<br/>\r\n7. Ability to input cuts at 1/2 depths.<br/>\r\n8. Includes GM & Ford high security and Lexus 80K code series.<br/>\r\n9. Easily updated through Internet or with Smart Media technology\r\n\r\n<hr/>\r\n\r\nHeight: 14"<hr/>\r\n\r\nWidth: 12"<hr/>\r\n\r\nLength: 14"<hr/>\r\n\r\nWeight: 50 pounds<hr/>\r\n\r\nCutter: 2.5 mm universal high speed steel', '', 1587),
(1235, 1, 'ATL-KL-2', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>KEYLINE 303 DUPLICATES HIGH SECURITY LASER KEY </h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe Keyline 303 duplicates high security lases and dimple type keys. This machine is the tank of its class at 51 lbs., with heavy casting that reduces vibration and noise while improving both cut consistency and cutter life.<hr/> \r\n\r\nCHARACTERISTICS<br/>\r\n1. Duplicates high security laser and dimple type keys.<br/>\r\n2. Microswitch activated cutter start with vertical and lateral carriage locking system to ease the cutting process.<br/>\r\n3. One-piece cast-iron body reduces vibration and noise improving both cut consistency and cutter life.<br/>\r\n4. Dual mode system; red button calibrates, black button cuts.<br/>\r\n5. Large, full view coverage shield for improved visibility and reduction of key shaving dispersal. <br/>\r\n6. Three dimensional calibration results in greater cut accuracy; machine beeps when calibrated correctly. <br/>\r\n7. Electronic height adjustment with directional indicator.<br/>\r\n8. Removable faceplates. <br/>\r\n9. Long-lasting and bright LED-style light. <br/>\r\n10. Storage tray at the base of the machine for tools, keys, etc.<br/>\r\n\r\n<hr/>\r\n\r\nHeight: 21"<hr/>\r\n\r\nWidth: 12"<hr/>\r\n\r\nLength: 15"<hr/>\r\n\r\nWeight: 51 pounds<hr/>\r\n\r\nCutter: 2.5 mm and 3 mm diameter high speed steel<hr/>\r\n\r\nMotor: 20 W, 7000 rpm.', '', 201);
