(1236, 1, 'ATL-BIC-5', '<h1>BIANCHI 106 SEMI- AUTOMATIC DUPLICATOR CUTTING MACHINE </h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe Bianchi 106 semi automatic is a heavy duty, quality duplicator and features several up grades such as built in chip tray, magnifying glass and a jaw locking mechanism that prevents accidental carriage release.<br/>\r\nCharacteristics<br/>\r\n\r\n1. Microswitch activation with improved spring loaded carriage design, ergonomic handles and smooth balanced operation.<br/>\r\n2. Unique one-piece jaw alignment system features a locking mechanism preventing accidental carriage release.<br/>\r\n3. Four-way reversible jaws securely clamp residential, commercial, padlock and automotive keys including single and double sided versions.<br/>\r\n4. Heavy-duty cast iron body dramatically reduces vibration and noise improving both cut consistency and cutter life\r\n5. Micrometric tracer adjustment for quick, easy and accurate depth calibration.<br/>\r\n6. Updated design features ergonomic handles and levers, removable chip tray and upper storage tray.<br/>\r\n7. Large transparent cutter shield and offset carriage improve viewing during cutting.<br/>\r\n8. Independent brush button for soft-touch deburring brush.<br/>\r\n9. Overhead light with drop-down magnifying glass illuminates key cutting area.<br/>\r\n10. Redesigned cutter blade features a steeper angle cut to better cut specific keys like Titan, Best and older style GM keys.<br/> \r\n<hr/>\r\nPart Number: B106<hr/>\r\n\r\nHeight: 17"<hr/>\r\n\r\nWidth: 15"<hr/>\r\n\r\nLength: 18"<hr/>\r\n\r\nWeight: 55 pounds<hr/>\r\n\r\nCutter: 80mm high speed steel<hr/>\r\n\r\nMotor: 1/4 hp, 1680 rpm.', '', 2),
