(1241, 1, 'ATL-KL-7', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>KEYLINE 884 DECRYPTOR ULTEGRA CLONING TOOL</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe Keyline 884 Decryptor Ultegra is the newest cloning tool from Bianchi. This fully integrated stand alone unit identifies and clones TI Fixed & Encrypted, Philips Crypto [2nd gen.] and more - including the new TK100 chip. No computer or attachments needed - software is built in.<hr/>\r\nCHARACTERISTICS<br/>\r\n \r\n1. Completely stand-alone unit; no computer needed<br/>\r\n2. Identifies and clones Philips Crypto (2nd generation) transponders.<br/>\r\n3. Identifies & clones TI Fixed & Encrypted code keys.<br/>\r\n4. Displays chip type, value and manufacturer.<br/>\r\n5. Compact, lightweight design with easy to read display.<br/>\r\n6. Code generation for fixed code transponders<br/>\r\n7. USB and Serial port terminals<br/>\r\n8. Multiple language capabilities<br/>\r\n<hr/>\r\n\r\nHeight: 3"<hr/>\r\n\r\nWidth: 5 1/4"<hr/>\r\n\r\nLength: 8 3/4"<hr/>\r\n\r\nWeight: 2 pounds<hr/>\r\n\r\nInterface: USB/Serial Port terminals', '', 478),
