(1282, 1, 'ATL-LAP-30', '<img border="0" src="/images/autotechsupply.jpg" alt="test" width="125" height="35" />\r\n\r\n<h1> OBD II TESTER AND KEYLESS ENTRY BYPASS OBD II PORT </h1>\r\n\r\n<hr/>\r\n\r\n<hr/>\r\n\r\n<h2>DESCRIPTION</h2><hr/><hr/>\r\n\r\n<h1>PROGRAMMING FUNCTIONS.<br/></h1>\r\nSwitch 1: Applies to pins 1 and 4 for programming keyless Entry for Chevrolet/ Mitsubishi/ Chrysler.<br/>\r\nSwitch 2:  Applies to pins 4 and 8 for programming keyless Entry for  Chevrolet/ Chrysler.<br/>\r\nSwitch 3: Corresponds to by-pass 33 minutes for programming of computer for Toyota/ Scion/ Lexus with immobilizer from 2004 and up.<br/>\r\nSwitch 4: Without use.<br/><br/>\r\n<h1>OBD2 TESTER<br/></h1>\r\nRed LED: Indicates VW K-line has a short circuit.<br/>\r\nGreen LED: Indicates whether the car has current in the OBD II port.<br/>\r\nOrange led. Indicates that the red and green leds are lit simultaneously, i.e. the vehicle has power but it has a short circuit in the k-line.', '', 569),
