(1297, 1, 'ATL-KL-8', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>VERSA</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe ultimate locksmith''s utility machine, the VERSA cuts by code, decode or depths and duplicates high security and dimple keys. The VERSA also engraves metal head keys to your specifications. <br/><hr/>\r\n\r\nCHARACTERISTICS<br/>\r\n\r\n1.Complete database of codes built in or can be used in conjunction with Instacode software.<br/>\r\n2. Includes four jaws; A01, A02, A03 for high security keys and C01 for dimple keys and engraving.<br/>\r\n3. Duplicates keys in seconds with 28,000 rpm industrial-type spindle.<br/> \r\n4. On-board computer operates on a Pentium 3 600mHz microprocessor with 128MB RAM.<br/>\r\n5. Additional ports include two USB ports, one LAN/Ethernet port, one 9-pin serial port, a monitor port, and a PS2 port for a mouse or keyboard.<br/>\r\n6. Internal modem and phone plug for Internet connection.<br/>\r\n7. Protective safety cover must be closed for machine to operate.<br/>\r\n8. Engraving feature allows for customizing metal head keys to your specifications.<br/>\r\n10. 7" SVGA computerized color touch screen with high resolution.\r\n\r\n<hr/>\r\nPart Number: VERSA<hr/>\r\n\r\nHeight: 21"<hr/>\r\n\r\nWidth: 15"<hr/>\r\n\r\nLength: 12"<hr/>\r\n\r\nWeight: 82 pounds<hr/>\r\n\r\nMotor: 200w, 28,000 rpm<hr/>\r\n\r\nCutter: 2.5mm carbide cutter for automotive keys; 90 degree carbide cutter for dimple keys', '', 429),
(1298, 1, 'ATL-KL-9', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n<h1>DEZMO </h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe Dezmo Base cuts flat keys by code and depths including commercial, residential, and single & double sided automotive keys with maximum efficiency and precision.<hr/> \r\n\r\nCHARACTERISTICS<br/>\r\n1. Stand alone unit; complete database of codes built-in.<br/>\r\n2. Accurately cuts flat keys by code and depths using a variable speed according to keyblank material.<br/>\r\n3. Capability to accept professional ERP and Master Keys System software.<br/>\r\n4. Four sided reversible jaws with X and Y controlled axis.<br/>\r\n5. Integrated full color touch screen console. <br/>\r\n6. Software updates via USB or Internet connection. <br/>\r\n7. Easy to use with superior reliability.<br/>\r\n\r\n<hr/>\r\n\r\nPart Number: Dezmo<hr/>\r\n\r\nHeight: 17 3/4"<hr/>\r\n\r\nWidth: 20"<hr/>\r\n\r\nLength: 10"<hr/>\r\n\r\nWeight: 99 pounds<hr/>\r\n\r\nCutter: 2.5 mm and 3 mm diameter high speed steel<hr/>\r\n\r\nMotor: Brushless, multi-speed<hr/>\r\n\r\nCutter: 80mm carbide', '', 247),
(1299, 1, 'ATL-KL-10', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>EASY <br/>\r\nBASIC SEMI-AUTOMATIC CYLINDER KEY CUTTING MACHINE</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe Easy is your basic key cutting machine. itâ€™s a reliable and solid workhorse that performs as you need it to.<hr/> \r\n\r\nCHARACTERISTICS<br/>\r\n1. Two-way reversible jaws ensure an excellent grip.<br/>\r\n2. Safety during cutter start is ensured by the forward movement of the carriage.<br/>\r\n3. Hardened tracer.<br/>\r\n4. Independent switch for brush operation.<br/>\r\n5. Protective plastic shield for operator safety. <br/>\r\n6. Motor and wiring protected with a fuse against accidental overloads. <br/>', '', 446),
(1300, 1, 'ATL-KL-11', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>LUPO\r\n</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\nLUPO is a basic key cutting machine with 4-sided jaws and a semi-automatic carriage with a safety switch. It has a lever to protect the gauge, ensuring it swings out of the way before you cut your key. It is a solid and reliable workhorse.<hr/> \r\n\r\nCHARACTERISTICS<br/>\r\n1.     Four-way reversible jaws.<br/>\r\n2.	Safety during cutter start is ensured by the forward movement of the carriage.<br/>\r\n3.	Halogen lamp illuminates the working area.<br/>\r\n4.	Release lever to protect key stops.<br/>\r\n5.	Hardened tracer with micro adjustment.<br/>\r\n6.	Independent switch for brush operation.<br/>\r\n7.	Protective plastic shield for operator safety.<br/>\r\n8.	Motor and wiring protected with a fuse against accidental overloads.<hr/>\r\n\r\nCutter: HSS 80x5x16<hr/>\r\nDimensions: 370x370x240 mm<hr/>\r\nWeight: 20 kg', '', 340),
(1301, 1, 'ATL-KL-12', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>CARACT QUATTRO\r\n</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\nWith this machine you wonâ€™t get sore hands from the handles as there are no sharp edges. The carriage can not be lifted until the key gauges have been moved out of the way.\r\nThe cutter will not start until the carriage is lifted or the brush button is pushed which will keep the user out of harmâ€™s way.<hr/> \r\n\r\nCHARACTERISTICS<br/>\r\n1.     Four-sided jaw mechanism enables solid clamping for a large majority of keys.<br/>\r\n2.	Selection of the jaw side is particularly simple, quick and easy. One push & turn motion for easy jaw selection<br/>\r\n3.	Ergonomic knobs make using this machine a pleasure..<br/>\r\n4.	Carriage is equipped with in-built safety mechanisms.<br/>\r\n5.	Micrometric adjustment of the tracer enables the user to apply a precise set\r\nup or correction of the cutting depth especially in the case of worn out keys.<br/>\r\n6.	Neon lamp illuminates the working area and magnifying glass enables full visual control of the cutting process.<br/>\r\n7.	Cleaning is simple! Collects shavings into a large tray which is incorporated\r\naesthetically and functionally into the structure of the key cutting machine.<br/>\r\n8.	Nylon brush<hr/>\r\n\r\nLength:	400 mm<hr/>\r\nWidth:	460 mm<hr/>	\r\nHeight (with lamp):	440mm<hr/>	\r\nWeight:	25 Kg<hr/>	\r\nSingle Speed Motor:	0.25 kw<hr/>	\r\nPrismatic Cutter: HSS 80x5x16<hr/>', '', 395),
(1302, 1, 'ATL-KL-13', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>ARCADIA\r\n</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nARCADIA  is Keyline''s new key cutting machine for tubular keys.\r\nIt can be used to cut tubular keys of several brands, thanks to the wide, ever expanding range of adapters available.\r\nIt was manufactured pursuant to the most recent safety standards. The electronic control starts the cutter only when it is close to the key; the high-security protection barrier and the LED light enhancing visibility in the work area make it possible to use this machine reliably, safely and pleasantly.\r\nThanks to the perfect engineering of its mechanism, it is also possible to use existing key cutting adapters, which, in turns, leads to the optimisation of the investment.<hr/>\r\n\r\nCutter: HSS Ã˜ 5.95 mm<hr/>\r\nWidth: 210 mm<hr/>\r\nHeight: 210 mm<hr/>\r\nDepth: 400 mm<hr/>\r\nWeight: 12.5 kg<hr/>\r\nEngine: 0.15 KW; 230 V - 50 Hz; 1.8 A; 2800 RPM', '', 394),
(1303, 1, 'ATL-KL-14', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>FALCON\r\n</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nFALCON is a code key cutting machine for special Tibbe-type keys for Ford and Jaguar vehicles, and for high security keys such as Abus and Abloy.<br/><br/>\r\nThis machine can cut a key on both sides without having to remove the key from the jaw, thanks to an integrated adaptor that makes it possible to rotate the key by 360Â°.<br/><br/>\r\nThe machine complies with all the newest safety standards: it has a safety feature that engages when the cutter is started and moves the carriage forwards, an independent switch to move the brush and a strong Plexiglas barrier.<br/><br/>\r\nFALCON is the only mechanical key cutting machine for special keys that combines ease of use and strength, thanks to the design of its base and to the reliable accessories, that guarantee the perfect stability of the key during the cutting phase, thus guaranteeing a perfect execution. Moreover, the innovative Easy Fit system makes it possible for the operator to secure the key without special tools.<br/><br/>\r\nFALCON integrates and develops the special keys sector, introducing practical new features, such as the exchangeable jaws and an innovative design.<br/><br/>\r\nThe engine and wires are protected by a fuse against accidental overloads, making this machine more reliable and more efficient.<hr/>\r\n\r\nCutter: HSS 80x22x2.5 mm<hr/>\r\nWidth: 400 mm<hr/>\r\nHeight: 230mm<hr/>\r\nDepth: 370 mm<hr/>\r\nWeight: 17 kg<hr/>\r\nEngine: Single phase 230V-180W-50Hz', '', 380),
