(1327, 1, 'ATL-KEY CLONING<br /> MACHINE-4', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n \r\n\r\n<h1>JMA TRS5000  EVO FOR TPX1 TPX2 TPH CLONING TOOLS</h1><hr/><hr/>\r\n\r\n\r\n<h2>DESCRIPTION</h2><hr/><hr/>\r\n\r\n<h1>THE MOST ADVANCED INTEGRATED TECHNOLOGY</h1><br/>\r\nElectronic cloning machine for duplicating transponders\r\nused in vehicle keys. Variations of the primary transponder\r\nbrands, Philips Â® and Texas Â®, including fixed and crypto\r\ncodes, can be cloned to TPX1, TPX2 and TPX4 cloning\r\ntransponders.<br/>\r\nThanks to the technology developed exclusively by JMA the\r\nTRS-5000 EVO is capable of cloning another transponder\r\nkey without the need for electronic heads or batteries,\r\nutilising the same technology as original transponders, and\r\nwithout a computer or internet connection.<br/>\r\nSoftware updating has never been simpler thanks to new\r\nPC software that allows TRS-5000 Evo and PC updates to\r\nbe downloaded and installed in a simple and automated\r\nmanner.<br/>\r\nThe simplicity of the machines usability is based on just\r\ntwo buttons (READ & COPY) for the recognition and cloning\r\nof transponder keys, displaying detailed information on\r\nthe transponder type, in addition to the steps to follow for\r\ncloning in a clear and easy fashion.<br/>\r\nIt can operate as a stand-alone device or connected to a\r\ncomputer through USB to utilise some additional features.<hr/>\r\n\r\nTECHNICAL DATA<hr/>\r\nWidth: 180 mm<hr/>\r\nHeight: 90 mm<hr/>\r\nDepth: 150 mm<hr/>\r\nWeight: 600gr.<hr/>\r\nPOWER SUPPLY<br/>\r\nExternal Power: 110/230V; 50/60Hz<br/>\r\nConsumption: 9V. d.c. / 2 Amperes<hr/>\r\nTECHNOLOGICAL DATA<br/>\r\nFrequency Antenna: 125 KHz / 134.2KHz<br/>\r\nInterface: RS232 Port Series & USB<br/>', '', 543),
