(1345, 1, 'ATL-KL-35', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n<h1>NINJA<br/>\r\nSINGLE & DOUBLE SIDED KEY CUTTING MACHINE</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nNINJA is the first and only compact, high precision key cutting machine for single-sided and double-sided flat keys, with code cutting, duplication and decoding functions.\r\nIts compact dimensions and attractive design make it appropriate for all work environments, from the most complete and professional structures to the small shops requiring an optimal use of space. The machine offers a single solution that joins  the simplest functions with the most evolved ones, for more expert locksmiths.\r\nNINJA is controlled through a light, portable console, designed to be placed either on top the machine, on the work bench or on the wall.\r\nIt has a stand-alone mode, used to run the basic duplication functions at an unparalleled speed, guaranteeing maximum precision and reliability, without need of a console or PC connection.\r\nIts next generation software includes several very useful functions, including the management of multiple users, the saving of the cut keys, the importing of customised data, communications via Instacode and Promaster, an on board user manual and the possibility of downloading the updates from the net.\r\nNINJA is equipped with the same exhaustive key database already installed in other Keyline products, so that the user can operate it with the utmost ease of use and speed in every circumstance.\r\nThe high technology on which it is based gives virtually unlimited possibilities of expansion, providing the locksmith with a valuable tool for the workplace in the new millennium.<hr/> \r\n\r\nCutter: 63 HSS (Widia optional)<hr/>\r\nMeasurementsWidth 300 mm; Depth 400 mm; Height 300 mm<hr/>\r\nWeight: 20 kg<hr/>\r\nEngine:Two-speed, single-phase, 0.18 KW 3000/1500 RPM<br/>\r\n<br/>', '', 1597),
