(1491, 1, 'ATL-KEY MACHINE-7', '<img border="0" src="/images/jma.jpg" alt="test" width="125" height="35" />\r\n<h1> JMA PROCODE </h1> \r\n\r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nJMA PROCODE<br/><br/>\r\n\r\nElectronically controlled machine for cutting flat cylinder and automotive keys by code.\r\n \r\nStand-alone or PC assisted operation.\r\n \r\nThe Procode is a highly reliable, precise and safe to operate machine. Highly flexible when integrating new files. Optional features include an electromagnetic reader with centesimal sensitivity and a complete code program. <br/><br/>\r\n\r\nMotor: 110V-50Hz 0.18KW <br/> \r\nDimensions: 16 Â½â€ x 12â€ x 21â€<br/>\r\n Weight: 95 lbs<br/>', '1', 581),
(1915, 1, 'ATL-ET-27', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />	\r\n<h1>TRANSPONDER TESTER *TDB002*</h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nThe TDB002 Transponder Tester offers a simple check to ensure  a key o remote control has a working transponder fitted and also a fast and easy way to check if the transponder is responding.<br/>\r\n\r\nIt is not always easy to check whether there is a transponder fitted when diagnosing vehicle key and immobilizer  problems, and the TDB002 offers a simple cost effective solution, saving time and money.<br/>\r\nThe TDB002 has a large aperture to allow most keys and remotes to be checked, it gives and indication that DATA is being sent by the transponder and the frequency at which the transponder is communicating, by way of LED''s and a sounder.<hr/>\r\n\r\nCan be used on all makes of vehicles, boats, trucks and motorcycles keys.<br/>\r\n* Test 134 KHz Transponder<br/>\r\n* Test 125 KHz Transponder<br/>\r\n* Tests Fixed and Crypto Transponders<br/>\r\n\r\n* Tests Remote Control Smart Key and normal type key transponders<hr/>\r\n\r\nBatteries: 3xAA<hr/>\r\nWeight: 115 grs<hr/>\r\n\r\nSize: 84 mm (W), 140 mm (H), 29 mm (D)<hr/>\r\n\r\nCurrent Consumption: 60 ma<hr/>\r\n\r\nFrequency Range: 125 KHz - 133 KHz<hr/>\r\n\r\nAuto Power off: 30 seconds<hr/>\r\n \r\n\r\nPART #: TDB002 <hr/>', '', 92),
