(1906, 1, 'ATL-ET-26', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />	\r\n<h1>MASTER OBD II CABLE  W/ LED LIGHT *ADC251*</h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nThe new master cable is ideal for searching for the OBD socket inside the vehicle.  Simply press the button located on connector housing and a bright LED light will illuminate the vehicle''s OBD socket - helping you to connect easily. <br/>\r\n\r\n \r\n\r\nThis cable is an optional addition to the ADC 250 Master Cable. Due to the physical size of the connector housing, this cable may not be compatible for certain vehicles. (ADC250 should be used in these cases)<hr/>\r\n\r\nPART #: ADC-251 <hr/>', '', 73),
