(1693, 1, 'ATL-TMPRO-1', '<h1>TMPRO\r\n</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nTransponder Maker Pro (TMPro) is a transponder programming tool and PIN calculator in one. Hardware is a small unit, which connects to a USB port. User interface supports 10 languages - Bulgarian, English, French, Portuguese, Polish, Hungarian, Spanish, Serbian, Italian and Czech. It is simple to use and offer wide range of supported immobilizer units. TMPro is designed to help in situations where either diagnostic tools or vehicle dealerships cannot help.</br>\r\n\r\n    TMPro has been produced as modular software. This means that every supported immobilizer unit is sold as separate modules. At beginning you can purchase hardware and only one module. In future you can add new modules by simple module purchasing system.</br>\r\n\r\n    TMPro works mainly with immobilizers EEPROM dumps. In order to use it you have to remove immobilizer unit from car, open it and to read specific memory device, which contain needed information. The software shows a picture of the immobilizer which is needed to be removed from the car and the memory device read. An information box is shown type of memory device and what is correct length of read file. Depending of immobilizer unit it may be serial EEPROM, Motorola MCU or Texas Instruments MCU. You can use any proper programmer to read data from it. TMPro works only with BIN or EEP files. </br>', '', 311),
