(1870, 1, 'ATL-KL-15', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n<h1>ATL-KL-15\r\n1996 - 2012 FORD HORSESHOE BLADE <br/> *H-72-PT-RW*\r\n</h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nFORD<hr/>COBRA: 1997<hr/>\r\nESCAPE: 2001 - 2012 <hr/>\r\nFIVE HUNDRED: 2005 - 2008<hr/>\r\nFLEX: 2009 - 2010<hr/>\r\nFOCUS: 2000 - 2010<hr/>\r\nGT: 2005 - 2006<hr/>\r\nFREESTYLE: 2005 - 2007<hr/>\r\nFUSION: 2006 - 2010<hr/>\r\nMUSTANG: 1996 - 2012<hr/>\r\nTAURUS: 1996 - 2011<hr/>\r\nTHUNDERBIRD: 1996 - 2005<hr/>\r\nE-SERIES: 2008 - 2012<hr/>\r\nEXCURSION: 2000 - 2006<hr/>\r\nEXPEDITION: 1997 - 2010<hr/>\r\nEXPLORER: 1998 - 2010 <hr/>\r\nF150: 1999 - 2010<hr/>\r\nF 250/ F 350: 1999 - 2010<hr/>\r\nFREESTART: 2004 - 2007<hr/>\r\nRANGER: 1999 - 2010<hr/>\r\nWINDSTART: 1998 - 2003<hr/>\r\nF 450: 2004 - 2010<hr/>\r\nCROWN VICTORIA: 1998 - 2012<hr/>\r\n\r\n\r\nMERCURY <hr/>GRAND MARQUIS: 1998 - 2011<hr/>\r\nMARAUDER: 2003 - 2005<hr/>\r\nMARINER: 2005 - 2011<hr/>\r\nMILAN: 2006 - 2011<hr/>\r\nMONTEGO: 2005 - 2008<hr/>\r\nSABLE: 1996 - 2009<hr/>\r\nMONTEREY: 2004 - 2007<hr/>\r\nMOUNTAINEER: 1998 - 2011<hr/>\r\n\r\nLINCOLN <hr/>AVIATOR: 2003 - 2007<hr/>\r\nBLACKWOOD: 2002<hr/>\r\nCONTINENTAL: 1998 - 2002<hr/>\r\nMARK LT: 2006 - 2008<hr/>\r\nMKT: 2010 - 2011<hr/>\r\nMKX: 2007 - 2011<hr/>\r\nMKZ: 2007 - 2011<hr/>\r\nNAVIGATOR: 1998 - 2011<hr/>\r\nTOWN CAR: 1998 - 2012<hr/>\r\nZEPHYR: 2006 - 2009<hr/>\r\n\r\n\r\n\r\nSERVICE KEY:  H86<hr/>\r\n\r\nCODE SERIES: 1X - 1706X <hr/>', '', 61),
(1772, 1, 'ATL-ET-16', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />	\r\n<h1>MITSUBISHI REMOTE PROGRAMMING ADAPTOR (ADC-194)   </h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nMITSUBISHI REMOTE PROGRAMMING ADAPTOR<hr/>\r\n\r\nPART #: ADC-194 <hr/>', '', 85),
(1773, 1, 'ATL-ET-17', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />\r\n<h1>MVP and TCODE SMART CARD FOR CALCULATOR  </h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nEach smart card can be used a maximum of 5000 times. After 500 uses the smart card will need to be re-charged via the Advanced Diagnostics website http://www.advanced-diagnostics.co.uk/htm/SmartCard-English.php. The card has a total of 10 recharges providing the 5000 limit.  Once the card has reached its 5000 limit, a new smart card will need to be used. The smart card is unique to each tester.<hr/>\r\n\r\nPART #: ADA-104 <hr/>', '', 104),
(1774, 1, 'ATL-ET-18', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />\r\n<h1>MVP and TCODE SMART CARD (2) & CALCULATOR  </h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nThe smart card security system consists of a calculator and smart card. \r\nThe smart card is required for each vehicle manufacturer after the system has been selected from the main vehicle menu. \r\nThe tester will display a code, to continue, the user must enter this code on the smart card calculator. \r\nA corresponding response code is then displayed on the smart card calculator, which must be entered back into the tester. Providing the  codes correspond, access to continue will be granted. \r\nAfter each response code is given the smart card''s uses count on the smart card will be reduced by one. \r\n\r\nEach smart card can be used a maximum of 5000 times. After 500 uses the smart card will need to be re-charged via the Advanced Diagnostics website http://www.advanced-diagnostics.co.uk/htm/SmartCard-English.php. The card has a total of 10 recharges providing the 5000 limit.  Once the card has reached its 5000 limit, a new smart card will need to be used. The smart card is unique to each tester.<hr/>\r\n\r\nPART #: ADA-105 <hr/>', '', 88),
(1775, 1, 'ATL-ET-19', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />	\r\n<h1>REMOTE FREQUENCY DETECTOR </h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\n The AD35 can check that radio frequency remote controls are operating correctly by displaying the frequency of the signal being transmitted.<hr/>\r\n\r\nPART #: AD-35 <hr/>', '', 145),
(1776, 1, 'ATL-ET-22', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />	\r\n<h1>2007 & UP HYUNDAI & KIA PIN CODE CALCULATION DONGLE * ADC-190* W/  VIDEO</h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\nConvert the car''s VIN number to the PIN Code for key and proximity programming.<br/>\r\n\r\nRequires MVP or TCode PRO machine with latest "Beta" software. \r\nYou can download the latest software for free at any time from www.TCODEUSA.com<hr/>\r\n\r\nPART #: ADC-190 <hr/>', '', 92),
(1777, 1, 'ATL-ET-20', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />\r\n<h1>ADC-116 OBD DIAGNOSTIC PORT TESTER</h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\nUse before conecting to the OBD Port to check for: 12 V - Proper Ground- Pin 7 line on VW & Audi''s  fitted with an after-market radio for correct wiring, to prevent equipment damage.\r\n\r\n<hr/>\r\n\r\nPART #: ADC-116 <hr/>', '', 84),
(1778, 1, 'ATL-ET-21', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />\r\n<h1>ADC-198 NISSAN PIN READ DONGLE</h1>  \r\n<hr/> \r\n<hr/>\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\nConverts  the serial number on the BMC (Body Control Module) to a PIN code on many 2003 - 2012 models.\r\n\r\n<hr/>\r\n\r\nPART #: ADC-198 <hr/>', '', 1),
(1780, 1, 'ATL-ET-23', '<img border="0" src="/images/elme-tools.jpg" alt="test" width="125" height="35" />	\r\n<h1>AD900 TRANSPONDER READER & CLONER TOOL</h1>  \r\n<hr/> \r\n<hr/>\r\n\r\n<h2> DESCRIPTION </h2> <hr/> <hr/>\r\n\r\n<h1>PC Software features</h1>  \r\n\r\n<br/>\r\n\r\n1. Clones all major brands of clonable transponders (Jet - JMA - Ilco)<br/>\r\n\r\n2. Unlimited transponder data save option.<br/>\r\n\r\n3. Read, write, identify most transponders <br/>\r\n\r\n4. USB download<br/>\r\n\r\n5. Locking T5 transponders<br/>\r\n\r\n6. Unlock Megamos Crypto 48<br/>\r\n\r\n7. Random Code generation for fixed code transponders<br/>\r\n\r\n8. Texas 4C & 4D copy<br/>\r\n\r\n9 Copy Philips Crypto 41, 42, 44 & 45<br/>\r\n\r\n10. PC Software\r\n\r\n\r\n\r\n\r\n\r\n<hr/>', '', 54),
