(1999, 1, 'ATL-SAT-22', '<img border="0" src="/images/generalmotor.jpg" alt="test" width="125" height="35" />\r\n\r\n<h1>2007 - 2010 SATURN  KEYLESS ENTRY  </h1>\r\n<hr/><hr/>\r\n<h2>DESCRIPTION</h2>\r\n<hr/> <hr/>\r\n\r\nOUTLOOK: 2007 - 2010<hr/>\r\n\r\nVUE: 2008 - 2010<hr/>\r\n\r\nGM ID  : 20952474/ 22936098/ 20868672 / 15913421 <hr/>\r\n\r\nFCC ID: OUC60221 & OUC60270 <hr/>\r\n\r\nFREQUENCY: 315 MHz<hr/>\r\n\r\nSTRATTEC #: 5922035<hr/>\r\n\r\nBATTERY PART #: CR2032<hr/>\r\n\r\nSIMILAR: ATL-CHE-44<hr/>\r\n\r\nPROGRAMMER TOOLS <hr/>\r\n\r\nTECH II / HOTWIRE / TCODE', '', 36),
