(2002, 1, 'ATL-KL-62', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>NEW KEYLINE 994 LASER KEY CUTTING MACHINE <br/>*included jaw a & c* </h1>\r\n\r\n\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe best key cutting machine for automotive laser keys, \r\nedge cut keys and Tibbe keys, cuts by code, by decode\r\nor by digital input of the key bittings, controlled\r\nby an innovative mobile console.<br/>\r\nThe insuperable level of ergonomic, compact and functional design,\r\nand of the mechanical precision maintains the accuracy, the security\r\nand the reliability at high levels, with a conception orientated\r\nto the future and a minimum energy consumption.<br/>\r\nThanks to the weight and the reduced dimensions, the key cutting\r\nmachine can be used anywhere, from the shop to the van, with\r\nthe freedom to put the console in a comfortable position,\r\non the working station or on the wall.<br/>\r\nThe console, practical and light-weighted, has a wide colored\r\ntouch screen, manufactured expressly to last in time and to endure\r\nto any working condition and to be easily used without too many concerns,\r\neven with the working gloves on. The console is supported by a stand with\r\na design studied to facilitate its use and to fix all the tools and accessories <hr/>\r\n\r\n\r\n<strong style="outline: none;"> <span style="outline: none; color: black;">For each 994 Laser bought,\r\ncustomers will receive an Instacode Token Box,\r\ncontaining </span>\r\n\r\n<span style="outline: none; color: red;">\r\na full free 1-year license.</span></strong><br/>\r\nInstacode, the # 1 Key Data Software worldwide,\r\na powerful tool to the Locksmith, easily connects\r\nwith Keylineâ€™s key-cutting machines and gives you\r\nseveral features (card Maker, Master Key Maker,\r\ncustomers database, etc.) which are essential\r\nto the key duplication professional.<hr/>\r\n\r\n<h1>Optimized management of the jaws</h1><hr/>\r\n994 Laser uses four jaws for laser keys, the G jaw\r\nfor edge cut keys (with symmetrical cut on both sides\r\nwithout the need to turn the key) and the H jaw\r\nfor Tibbe systems, with one tracer.<br/>\r\nEasy to replace, they guarantee the perfect anchoring\r\nwithout the need of optional adaptors and are equipped\r\nwith incorporated tip stop.<hr/>\r\n\r\n<h1>functions</h1><br/>\r\n\r\n1. Simplified procedures for a maximum ease of use.<br/>\r\n2. Complete database on board.<br/>\r\n3. Search for item, brand, model and year of the vehicle\r\nwith preview of the profile and of the key.<br/>\r\n4. Instant research by code even with the partial insertion\r\nof the depth.<br/>\r\n5. Cut starting from the original, inserting the code\r\nor the known values of the coding.<br/>\r\n6. Dynamic graphic representation of the cut,\r\nas while decoding as with the insertion of the coding.<br/>\r\n7. Memorization in the internal database of the notes\r\non the cutting of each key.<br/>\r\n8. Management of the favorites and of the accounts.<br/>\r\n9. Online help.<br/>\r\n10. Updates via internet or with flash drives.<br/>\r\n<hr/>\r\n\r\n\r\n<h1>CHARACTERISTICS</h1><br/>\r\n\r\nHeight: 350 mm<hr/>\r\n\r\nWidth: 300 mm<hr/>\r\n\r\nDepth: 360 mm<hr/>\r\n\r\nWeight Machine Body: 16.5 Kg<hr/>\r\n\r\nWeight Console: 0.8 Kg<hr/>\r\n\r\nCutter: Ã¸ 2.5 mm for laser and Tibbe Keys <br/>\r\nÃ¸ 1.5 mm for edge cut keys<hr/>\r\n\r\n\r\nJaws: 6 jaws are available: A, B, C, D for\r\nlaser keys; G for edge cut automotive\r\nkeys; H for Tibbe keys (6 spaces)<hr/>', '', 496),
(2003, 1, 'ATL-KL-63', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>LASER 994 YELLOW JAW (G) </h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe G jaw\r\nfor edge cut keys (with symmetrical cut on both sides\r\nwithout the need to turn the key).<br/>\r\nTHE G Jaw replaces F Jaw.<br/>\r\nThe G Jaw has the advantage that \r\nyou do not need to change \r\nthe tracer when you use other jaws\r\n to cut high security keys.\r\n\r\n\r\n<hr/>', '', 14),
(2004, 1, 'ATL-KL-64', '<img border="0" src="/images/keyline.png" alt="test" width="125" height="35" />\r\n\r\n<h1>LASER 994 JAW (H) </h1>\r\n\r\n<hr/><hr/>\r\n<h2>DESCRIPTION </h2>\r\n<hr/><hr/>\r\n\r\nThe H jaw\r\nfor Tibbe systems.<br/>\r\nAll the Jaws with one tracer.\r\n\r\n\r\n<hr/>', '', 19),
